import React from 'react';
import './index.css';

export default function Footer() {
    return (
        <div id="footer" className="mt-5">
            <div className="footerStripe" style={{ backgroundColor: "#F14F4F" }}></div>
            <div className="footerStripe" style={{ backgroundColor: "#F1D74F" }}></div>
            <div className="footerStripe" style={{ backgroundColor: "#84D7AF" }}></div>
            <div className="githubSprite d-inline-block"></div>
            <div className="linkedInSprite d-inline-block"></div>
            <div className="emailSprite d-inline-block"></div>
            <div className="d-inline-block text-end mt-1"><a href="#">back to top ↑</a></div>
            <p className="text-center mt-2">made with ♥ by Sara Alvarado<br></br>
            built with react</p>
        </div>
    );
}
